import React from 'react';

interface NavItem {
  name: string;
  href: string;
}

interface NavLinksProps {
  navItems: NavItem[];
  className?: string;
}

const NavLinks: React.FC<NavLinksProps> = ({ navItems, className, ...props }) => {
  return (
    <ul className={`${className}`} {...props}>
      {navItems.map((item, index) => (
        <li key={index} className={`mb-2 md:mx-10 md:mb-0 `}>
          <a href={item.href}>{item.name}</a>
        </li>
      ))}
    </ul>
  );
};

export default NavLinks;
